import {Fragment} from "react";
import Cards from "./Card"

const Cart = ({ cart, setCart }) => {
  
    return (
      <Fragment>
          {cart.length === 0 ? (<p>No hay nada por aqu√≠...</p>) : (cart.map((item) => (
              <Cards
                key={item.id}
                burger={item}
                cart={cart}
                setCart={setCart}
              />
            ))
          )}
      </Fragment>
    );
  };
  export default Cart;
